import React from 'react';

import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';

import { DataGrid } from '@mui/x-data-grid';

function Ranking() {
  const columns = [
    { field: 'id', headerName: 'Rang', width: 70 },
    { field: 'player', headerName: 'Joueur', width: 130 },
    {
      field: 'points', headerName: 'Points', type: 'number', width: 130,
    },
  ];

  const rows = [
    {
      id: 1, player: 'Louis Jouve', points: 35,
    },
    {
      id: 2, player: 'Thomas Jouve', points: 42,
    },
    {
      id: 3, player: 'Lannister', points: 45,
    },
    {
      id: 4, player: 'Stark', points: 16,
    },
    {
      id: 5, player: 'Targaryen', points: null,
    },
    {
      id: 6, player: 'Melisandre', points: 150,
    },
    {
      id: 7, player: 'Clifford', points: 44,
    },
    {
      id: 8, player: 'Frances', points: 36,
    },
    {
      id: 9, player: 'Roxie', points: 65,
    },
  ];

  return (
    <Container id="ranking" maxWidth="lg" sx={{ position: 'relative' }}>
      <Typography
        variant="h4"
        align="center"
        color="primary"
        m={8}
      >
        Le classement
      </Typography>
      <div style={{ height: 300, width: '100%' }}>
        <DataGrid rows={rows} columns={columns} />
      </div>
    </Container>
  );
}

export default Ranking;
